            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "AddedById", "Description", "Director", "GenreId", "ImageUrl", "RatingCount", "RunningTime", "Title", "TrailerUrl", "UserRating" },
                values: new object[,]
                {
                    { 1, "156fc675-02de-4250-9edb-869c85e13e61", "Chronicles the experiences of a formerly successful banker as a prisoner in the gloomy jailhouse of Shawshank after being found guilty of a crime he did not commit. The film portrays the man's unique way of dealing with his new, torturous life; along the way he befriends a number of fellow prisoners, most notably a wise long-term inmate named Red.", "Frank Darabont", 1, "TheShawshankRedemption.jpg", 0, 142, "The Shawshank Redemption", "https://www.youtube.com/watch?v=NmzuHjWmXOc", 0m },
                    { 2, "8980e4ca-2628-490d-840a-9c9414ab9f33", "The Godfather \"Don\" Vito Corleone is the head of the Corleone mafia family in New York. He is at the event of his daughter's wedding. Michael, Vito's youngest son and a decorated WW II Marine is also present at the wedding. Michael seems to be uninterested in being a part of the family business. Vito is a powerful man, and is kind to all those who give him respect but is ruthless against those who do not. But when a powerful and treacherous rival wants to sell drugs and needs the Don's influence for the same, Vito refuses to do it. What follows is a clash between Vito's fading old values and the new ways which may cause Michael to do the thing he was most reluctant in doing and wage a mob war against all the other mafia families which could tear the Corleone family apart.", "Francis Ford Coppola", 2, "TheGodfather.jpg", 0, 175, "The Godfather", "https://www.youtube.com/watch?v=sY1S34973zA", 0m },
                    { 3, "218dcf68-aa10-4c63-994f-50853fb19296", "The continuing saga of the Corleone crime family tells the story of a young Vito Corleone growing up in Sicily and in 1910s New York; and follows Michael Corleone in the 1950s as he attempts to expand the family business into Las Vegas, Hollywood and Cuba.", "Francis Ford Coppola", 2, "TheGodfatherPartII.jpg", 0, 202, "The Godfather Part II", "https://www.youtube.com/watch?v=9O1Iy9od7-A", 0m },
                    { 4, "60223fcf-5fa4-434f-a4ba-9389a4f571a0", "Jules Winnfield (Samuel L. Jackson) and Vincent Vega (John Travolta) are two hit men who are out to retrieve a suitcase stolen from their employer, mob boss Marsellus Wallace (Ving Rhames). Wallace has also asked Vincent to take his wife Mia (Uma Thurman) out a few days later when Wallace himself will be out of town. Butch Coolidge (Bruce Willis) is an aging boxer who is paid by Wallace to lose his fight. The lives of these seemingly unrelated people are woven together comprising of a series of funny, bizarre and uncalled-for incidents.", "Quentin Tarantino", 2, "PulpFiction.jpg", 0, 154, "Pulp Fiction", "https://www.youtube.com/watch?v=s7EdQ4FqbhY", 0m },
                    { 5, "ea811464-0c63-4c45-ac26-d4eb5bff334f", "Blondie, The Good (Clint Eastwood), is a professional gunslinger who is out trying to earn a few dollars. Angel Eyes, The Bad (Lee Van Cleef), is a hitman who always commits to a task and sees it through--as long as he's paid to do so. And Tuco, The Ugly (Eli Wallach), is a wanted outlaw trying to take care of his own hide. Tuco and Blondie share a partnership making money off of Tuco's bounty, but when Blondie unties the partnership, Tuco tries to hunt down Blondie. When Blondie and Tuco come across a horse carriage loaded with dead bodies, they soon learn from the only survivor, Bill Carson (Antonio Casale), that he and a few other men have buried a stash of gold in a cemetery. Unfortunately, Carson dies and Tuco only finds out the name of the cemetery, while Blondie finds out the name on the grave. Now the two must keep each other alive in order to find the gold. Angel Eyes (who had been looking for Bill Carson) discovers that Tuco and Blondie met with Carson and knows they know where the gold is; now he needs them to lead him to it. Now The Good, the Bad, and the Ugly must all battle it out to get their hands on $200,000.00 worth of gold.", "Sergio Leone", 3, "TheGood,theBadandtheUgly.jpg", 0, 178, "The Good, the Bad and the Ugly", "https://www.youtube.com/watch?v=WCN5JJY_wiA", 0m },
                    { 6, "156fc675-02de-4250-9edb-869c85e13e61", "Set within a year after the events of Batman Begins (2005), Batman, Lieutenant James Gordon, and new District Attorney Harvey Dent successfully begin to round up the criminals that plague Gotham City, until a mysterious and sadistic criminal mastermind known only as \"The Joker\" appears in Gotham, creating a new wave of chaos. Batman's struggle against The Joker becomes deeply personal, forcing him to \"confront everything he believes\" and improve his technology to stop him. A love triangle develops between Bruce Wayne, Dent, and Rachel Dawes.", "Christopher Nolan", 4, "TheDarkKnight.jpg", 0, 152, "The Dark Knight", "https://www.youtube.com/watch?v=EXeTwQWrcwY", 0m },
                    { 7, "610ab053-2c5a-451b-9634-03b59ea4a473", "The defense and the prosecution have rested, and the jury is filing into the jury room to decide if a young man is guilty or innocent of murdering his father. What begins as an open-and-shut case of murder soon becomes a detective story that presents a succession of clues creating doubt, and a mini-drama of each of the jurors' prejudices and preconceptions about the trial, the accused, AND each other. Based on the play, all of the action takes place on the stage of the jury room.", "Sidney Lumet", 2, "12AngryMen.jpg", 0, 96, "12 Angry Men", "https://www.youtube.com/watch?v=TEN-2uTi2c0", 0m },
                    { 8, "156fc675-02de-4250-9edb-869c85e13e61", "Oskar Schindler is a vain and greedy German businessman who becomes an unlikely humanitarian amid the barbaric German Nazi reign when he feels compelled to turn his factory into a refuge for Jews. Based on the true story of Oskar Schindler who managed to save about 1100 Jews from being gassed at the Auschwitz concentration camp, it is a testament to the good in all of us.", "Steven Spielberg", 5, "Schindler'sList.jpg", 0, 195, "Schindler's List", "https://www.youtube.com/watch?v=gG22XNhtnoY", 0m },
                    { 9, "610ab053-2c5a-451b-9634-03b59ea4a473", "The final confrontation between the forces of good and evil fighting for control of the future of Middle-earth. Frodo and Sam reach Mordor in their quest to destroy the One Ring, while Aragorn leads the forces of good against Sauron's evil army at the stone city of Minas Tirith.", "Peter Jackson", 4, "TheLordoftheRingsTheReturnoftheKing.jpg", 0, 201, "The Lord of the Rings: The Return of the King", "https://www.youtube.com/watch?v=r5X-hFf6Bwo", 0m },
                    { 10, "64ca1994-bfd0-4d26-8ec4-4d1bc82bd95c", "A nameless first person narrator (Edward Norton) attends support groups in attempt to subdue his emotional state and relieve his insomniac state. When he meets Marla (Helena Bonham Carter), another fake attendee of support groups, his life seems to become a little more bearable. However when he associates himself with Tyler (Brad Pitt) he is dragged into an underground fight club and soap making scheme. Together the two men spiral out of control and engage in competitive rivalry for love and power.", "David Fincher", 1, "FightClub.jpg", 0, 139, "Fight Club", "https://www.youtube.com/watch?v=qtRKdVHc-cE", 0m },
                    { 11, "60223fcf-5fa4-434f-a4ba-9389a4f571a0", "Luke Skywalker, Han Solo, Princess Leia and Chewbacca face attack by the Imperial forces and its AT-AT walkers on the ice planet Hoth. While Han and Leia escape in the Millennium Falcon, Luke travels to Dagobah in search of Yoda. Only with the Jedi Master's help will Luke survive when the Dark Side of the Force beckons him into the ultimate duel with Darth Vader.", "Irvin Kershner", 4, "StarWarsEpisodeV-TheEmpireStrikesBack.jpg", 0, 124, "Star Wars: Episode V - The Empire Strikes Back", "https://www.youtube.com/watch?v=JNwNXF9Y6kY", 0m },
                    { 12, "ea811464-0c63-4c45-ac26-d4eb5bff334f", "An ancient Ring thought lost for centuries has been found, and through a strange twist of fate has been given to a small Hobbit named Frodo. When Gandalf discovers the Ring is in fact the One Ring of the Dark Lord Sauron, Frodo must make an epic quest to the Cracks of Doom in order to destroy it. However, he does not go alone. He is joined by Gandalf, Legolas the elf, Gimli the Dwarf, Aragorn, Boromir, and his three Hobbit friends Merry, Pippin, and Samwise. Through mountains, snow, darkness, forests, rivers and plains, facing evil and danger at every corner the Fellowship of the Ring must go. Their quest to destroy the One Ring is the only hope for the end of the Dark Lords reign.", "Peter Jackson", 4, "TheLordoftheRingsTheFellowshipoftheRing.jpg", 0, 178, "The Lord of the Rings: The Fellowship of the Ring", "https://www.youtube.com/watch?v=V75dMMIW2B4", 0m },
                    { 13, "218dcf68-aa10-4c63-994f-50853fb19296", "McMurphy has a criminal past and has once again gotten himself into trouble and is sentenced by the court. To escape labor duties in prison, McMurphy pleads insanity and is sent to a ward for the mentally unstable. Once here, McMurphy both endures and stands witness to the abuse and degradation of the oppressive Nurse Ratched, who gains superiority and power through the flaws of the other inmates. McMurphy and the other inmates band together to make a rebellious stance against the atrocious Nurse.", "Milos Forman", 1, "OneFlewOvertheCuckoo'sNest.jpg", 0, 133, "One Flew Over the Cuckoo's Nest", "https://www.youtube.com/watch?v=OXrcDonY-B8", 0m }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "AddedById", "Description", "Director", "GenreId", "ImageUrl", "RatingCount", "RunningTime", "Title", "TrailerUrl", "UserRating" },
                values: new object[,]
                {
                    { 14, "5556c45e-395d-402b-b765-750666b092fc", "Dom Cobb is a skilled thief, the absolute best in the dangerous art of extraction, stealing valuable secrets from deep within the subconscious during the dream state, when the mind is at its most vulnerable. Cobb's rare ability has made him a coveted player in this treacherous new world of corporate espionage, but it has also made him an international fugitive and cost him everything he has ever loved. Now Cobb is being offered a chance at redemption. One last job could give him his life back but only if he can accomplish the impossible, inception. Instead of the perfect heist, Cobb and his team of specialists have to pull off the reverse: their task is not to steal an idea, but to plant one. If they succeed, it could be the perfect crime. But no amount of careful planning or expertise can prepare the team for the dangerous enemy that seems to predict their every move. An enemy that only Cobb could have seen coming.", "Christopher Nolan", 4, "Inception.jpg", 0, 148, "Inception", "https://www.youtube.com/watch?v=YoHD9XEInc0", 0m },
                    { 15, "156fc675-02de-4250-9edb-869c85e13e61", "Henry Hill might be a small time gangster, who may have taken part in a robbery with Jimmy Conway and Tommy De Vito, two other gangsters who might have set their sights a bit higher. His two partners could kill off everyone else involved in the robbery, and slowly start to think about climbing up through the hierarchy of the Mob. Henry, however, might be badly affected by his partners' success, but will he consider stooping low enough to bring about the downfall of Jimmy and Tommy?", "Martin Scorsese", 5, "Goodfellas.jpg", 0, 145, "Goodfellas", "https://www.youtube.com/watch?v=2ilzidi_J8Q", 0m },
                    { 16, "2055e8c8-5a8e-49c3-9f0a-a987700af2ee", "The Imperial Forces, under orders from cruel Darth Vader, hold Princess Leia hostage in their efforts to quell the rebellion against the Galactic Empire. Luke Skywalker and Han Solo, captain of the Millennium Falcon, work together with the companionable droid duo R2-D2 and C-3PO to rescue the beautiful princess, help the Rebel Alliance and restore freedom and justice to the Galaxy.", "George Lucas", 4, "StarWarsEpisodeIV-ANewHope.jpg", 0, 121, "Star Wars: Episode IV - A New Hope", "https://www.youtube.com/watch?v=vZ734NWnAHA", 0m },
                    { 17, "2055e8c8-5a8e-49c3-9f0a-a987700af2ee", "A veteran samurai, who has fallen on hard times, answers a village's request for protection from bandits. He gathers 6 other samurai to help him, and they teach the townspeople how to defend themselves, and they supply the samurai with three small meals a day. The film culminates in a giant battle when 40 bandits attack the village.", "Akira Kurosawa", 4, "SevenSamurai.jpg", 0, 207, "Seven Samurai", "https://www.youtube.com/watch?v=wJ1TOratCTo", 0m },
                    { 18, "156fc675-02de-4250-9edb-869c85e13e61", "Forrest Gump is a simple man with a low I.Q. but good intentions. He is running through childhood with his best and only friend Jenny. His 'mama' teaches him the ways of life and leaves him to choose his destiny. Forrest joins the army for service in Vietnam, finding new friends called Dan and Bubba, he wins medals, creates a famous shrimp fishing fleet, inspires people to jog, starts a ping-pong craze, creates the smiley, writes bumper stickers and songs, donates to people and meets the president several times. However, this is all irrelevant to Forrest who can only think of his childhood sweetheart Jenny Curran, who has messed up her life. Although in the end all he wants to prove is that anyone can love anyone.", "Robert Zemeckis", 1, "ForrestGump.jpg", 0, 142, "Forrest Gump", "https://www.youtube.com/watch?v=bLvqoHBptjg", 0m },
                    { 19, "ea811464-0c63-4c45-ac26-d4eb5bff334f", "Thomas A. Anderson is a man living two lives. By day he is an average computer programmer and by night a hacker known as Neo. Neo has always questioned his reality, but the truth is far beyond his imagination. Neo finds himself targeted by the police when he is contacted by Morpheus, a legendary computer hacker branded a terrorist by the government. As a rebel against the machines, Neo must confront the agents: super-powerful computer programs devoted to stopping Neo and the entire human rebellion.", "Lana Wachowski, Lilly Wachowski", 4, "TheMatrix.jpg", 0, 136, "The Matrix", "https://www.youtube.com/watch?v=vKQi3bBA1y8", 0m },
                    { 20, "2055e8c8-5a8e-49c3-9f0a-a987700af2ee", "The continuing quest of Frodo and the Fellowship to destroy the One Ring. Frodo and Sam discover they are being followed by the mysterious Gollum. Aragorn, the Elf archer Legolas, and Gimli the Dwarf encounter the besieged Rohan kingdom, whose once great King Theoden has fallen under Saruman's deadly spell.", "Peter Jackson", 4, "TheLordoftheRingsTheTwoTowers.jpg", 0, 179, "The Lord of the Rings: The Two Towers", "https://www.youtube.com/watch?v=LbfMDwc4azU", 0m },
                    { 21, "60223fcf-5fa4-434f-a4ba-9389a4f571a0", "Brazil, 1960s, City of God. The Tender Trio robs motels and gas trucks. Younger kids watch and learn well...too well. 1970s: Li'l Zé has prospered very well and owns the city. He causes violence and fear as he wipes out rival gangs without mercy. His best friend Bené is the only one to keep him on the good side of sanity. Rocket has watched these two gain power for years, and he wants no part of it. he keeps getting swept up in the madness. All he wants to do is take pictures. 1980s: Things are out of control between the last two remaining gangs...will it ever end? Welcome to the City of God.", "Fernando Meirelles, Kátia Lund", 2, "CityofGod.jpg", 0, 130, "City of God", "https://www.youtube.com/watch?v=dcUOO4Itgmw", 0m },
                    { 22, "2055e8c8-5a8e-49c3-9f0a-a987700af2ee", "A film about two homicide detectives' (Morgan Freeman and Brad Pitt) desperate hunt for a serial killer who justifies his crimes as absolution for the world's ignorance of the Seven Deadly Sins. The movie takes us from the tortured remains of one victim to the next as the sociopathic \"John Doe\" (Kevin Spacey) sermonizes to Detectives Somerset and Mills -- one sin at a time. The sin of Gluttony comes first and the murderer's terrible capacity is graphically demonstrated in the dark and subdued tones characteristic of film noir. The seasoned and cultured but jaded Somerset researches the Seven Deadly Sins in an effort to understand the killer's modus operandi while the bright but green and impulsive Detective Mills (Pitt) scoffs at his efforts to get inside the mind of a killer...", "David Fincher", 2, "Se7en.jpg", 0, 127, "Se7en", "https://www.youtube.com/watch?v=znmZoVkCjpI", 0m },
                    { 23, "a9b6dc74-38a5-4794-a703-59204f461adb", "F.B.I. trainee Clarice Starling (Jodie Foster) works hard to advance her career, while trying to hide or put behind her West Virginia roots, of which if some knew, would automatically classify her as being backward or white trash. After graduation, she aspires to work in the agency's Behavioral Science Unit under the leadership of Jack Crawford (Scott Glenn). While she is still a trainee, Crawford asks her to question Dr. Hannibal Lecter (Sir Anthony Hopkins), a psychiatrist imprisoned, thus far, for eight years in maximum security isolation for being a serial killer who cannibalized his victims. Clarice is able to figure out the assignment is to pick Lecter's brains to help them solve another serial murder case, that of someone coined by the media as \"Buffalo Bill\" (Ted Levine), who has so far killed five victims, all located in the eastern U.S., all young women, who are slightly overweight (especially around the hips), all who were drowned in natural bodies of water, and all who were stripped of large swaths of skin. She also figures that Crawford chose her, as a woman, to be able to trigger some emotional response from Lecter. After speaking to Lecter for the first time, she realizes that everything with him will be a psychological game, with her often having to read between the very cryptic lines he provides. She has to decide how much she will play along, as his request in return for talking to him is to expose herself emotionally to him. The case takes a more dire turn when a sixth victim is discovered, this one from who they are able to retrieve a key piece of evidence, if Lecter is being forthright as to its meaning. A potential seventh victim is high profile Catherine Martin (Brooke Smith), the daughter of Senator Ruth Martin (Diane Baker), which places greater scrutiny on the case as they search for a hopefully still alive Catherine. Who may factor into what happens is Dr. Frederick Chilton (Anthony Heald), the warden at the prison, an opportunist who sees the higher profile with Catherine, meaning a higher profile for himself if he can insert himself successfully into the proceedings.", "Jonathan Demme", 2, "TheSilenceoftheLambs.jpg", 0, 118, "The Silence of the Lambs", "https://www.youtube.com/watch?v=W6Mm8Sbe__o", 0m },
                    { 24, "218dcf68-aa10-4c63-994f-50853fb19296", "Jill McBain travels to the wild frontier, Utah, where she and her new husband planned to settle down, but upon arrival, she finds him and his children dead. There's a lot of land, and potential, but there are also those who want to take it--at any cost. Even if it means killing a man and his kids.", "Sergio Leone", 6, "OnceUponaTimeintheWest.jpg", 0, 165, "Once Upon a Time in the West", "https://www.youtube.com/watch?v=c8CJ6L0I6W8", 0m },
                    { 25, "156fc675-02de-4250-9edb-869c85e13e61", "The story of Rick Blaine, a cynical world-weary ex-patriate who runs a nightclub in Casablanca, Morocco during the early stages of WWII. Despite the pressure he constantly receives from the local authorities, Rick's cafe has become a kind of haven for refugees seeking to obtain illicit letters that will help them escape to America. But when Ilsa, a former lover of Rick's, and her husband, show up to his cafe one day, Rick faces a tough challenge which will bring up unforeseen complications, heartbreak and ultimately an excruciating decision to make.", "Michael Curtiz", 1, "Casablanca.jpg", 0, 102, "Casablanca", "https://www.youtube.com/watch?v=MF7JH_54d8c", 0m },
                    { 26, "60223fcf-5fa4-434f-a4ba-9389a4f571a0", "Following a truck hijack in New York, five criminals are arrested and brought together for questioning. As none of them are guilty, they plan a revenge operation against the police. The operation goes well, but then the influence of a legendary mastermind criminal called Keyser Söze is felt. It becomes clear that each one of them has wronged Söze at some point and must pay back now. The payback job leaves 27 men dead in a boat explosion, but the real question arises now: Who actually is Keyser Söze?", "Bryan Singer", 2, "TheUsualSuspects.jpg", 0, 106, "The Usual Suspects", "https://www.youtube.com/watch?v=Q0eCiCinc4E", 0m },
                    { 27, "2055e8c8-5a8e-49c3-9f0a-a987700af2ee", "The year is 1936. An archeology professor named Indiana Jones is venturing in the jungles of South America searching for a golden statue. Unfortunately, he sets off a deadly trap but miraculously escapes. Then, Jones hears from a museum curator named Marcus Brody about a biblical artifact called The Ark of the Covenant, which can hold the key to human existence. Jones has to venture to vast places such as Nepal and Egypt to find this artifact. However, he will have to fight his enemy Rene Belloq and a band of Nazis in order to reach it.", "Steven Spielberg", 4, "IndianaJonesandtheRaidersoftheLostArk.jpg", 0, 115, "Indiana Jones and the Raiders of the Lost Ark", "https://www.youtube.com/watch?v=0xQSIdSRlAk", 0m },
                    { 28, "5556c45e-395d-402b-b765-750666b092fc", "Professional photographer L.B. \"Jeff\" Jefferies breaks his leg while getting an action shot at an auto race. Confined to his New York apartment, he spends his time looking out of the rear window observing the neighbors. He begins to suspect that a man across the courtyard may have murdered his wife. Jeff enlists the help of his high society fashion-consultant girlfriend Lisa Fremont and his visiting nurse Stella to investigate.", "Alfred Hitchcock", 7, "RearWindow.jpg", 0, 112, "Rear Window", "https://www.youtube.com/watch?v=m01YktiEZCw", 0m },
                    { 29, "610ab053-2c5a-451b-9634-03b59ea4a473", "George Bailey has spent his entire life giving of himself to the people of Bedford Falls. He has always longed to travel but never had the opportunity in order to prevent rich skinflint Mr. Potter from taking over the entire town. All that prevents him from doing so is George's modest building and loan company, which was founded by his generous father. But on Christmas Eve, George's Uncle Billy loses the business's $8,000 while intending to deposit it in the bank. Potter finds the misplaced money and hides it from Billy. When the bank examiner discovers the shortage later that night, George realizes that he will be held responsible and sent to jail and the company will collapse, finally allowing Potter to take over the town. Thinking of his wife, their young children, and others he loves will be better off with him dead, he contemplates suicide. But the prayers of his loved ones result in a gentle angel named Clarence coming to earth to help George, with the promise of earning his wings. He shows George what things would have been like if he had never been born.", "Frank Capra", 1, "It'saWonderfulLife.jpg", 0, 130, "It's a Wonderful Life", "https://www.youtube.com/watch?v=iLR3gZrU2Xo", 0m },
                    { 30, "2055e8c8-5a8e-49c3-9f0a-a987700af2ee", "Phoenix office worker Marion Crane is fed up with the way life has treated her. She has to meet her lover Sam in lunch breaks, and they cannot get married because Sam has to give most of his money away in alimony. One Friday, Marion is trusted to bank forty thousand dollars by her employer. Seeing the opportunity to take the money and start a new life, Marion leaves town and heads towards Sam's California store. Tired after the long drive and caught in a storm, she gets off the main highway and pulls into the Bates Motel. The motel is managed by a quiet young man called Norman who seems to be dominated by his mother.", "Alfred Hitchcock", 8, "Psycho.jpg", 0, 109, "Psycho", "https://www.youtube.com/watch?v=Wz719b9QUqY", 0m },
                    { 31, "a9b6dc74-38a5-4794-a703-59204f461adb", "After her father, step-mother, step-sister and little brother are killed by her father's employers, the 12-year-old daughter of an abject drug dealer manages to take refuge in the apartment of a professional hitman who at her request teaches her the methods of his job so she can take her revenge on the corrupt DEA agent who ruined her life by killing her beloved brother.", "Luc Besson", 4, "LéonTheProfessional.jpg", 0, 110, "Léon: The Professional", "https://www.youtube.com/watch?v=aNQqoExfQsg", 0m },
                    { 32, "ea811464-0c63-4c45-ac26-d4eb5bff334f", "In Hollywood of the 50's, the obscure screenplay writer Joe Gillis is not able to sell his work to the studios, is full of debts and is thinking in returning to his hometown to work in an office. While trying to escape from his creditors, he has a flat tire and parks his car in a decadent mansion in Sunset Boulevard. He meets the owner and former silent-movie star Norma Desmond, who lives alone with her butler and driver Max Von Mayerling. Norma is demented and believes she will return to the cinema industry, and is protected and isolated from the world by Max, who was her director and husband in the past and still loves her. Norma proposes Joe to move to the mansion and help her in writing a screenplay for her comeback to the cinema, and the small-time writer becomes her lover and gigolo. When Joe falls in love for the young aspirant writer Betty Schaefer, Norma becomes jealous and completely insane and her madness leads to a tragic end.", "Billy Wilder", 1, "SunsetBlvd..jpg", 0, 110, "Sunset Blvd.", "https://www.youtube.com/watch?v=_dY0SVxnHjQ", 0m },
                    { 33, "5556c45e-395d-402b-b765-750666b092fc", "Derek Vineyard is paroled after serving 3 years in prison for brutally killing two black men who tried to break into/steal his truck. Through his brother's, Danny Vineyard, narration, we learn that before going to prison, Derek was a skinhead and the leader of a violent white supremacist gang that committed acts of racial crime throughout L.A. and his actions greatly influenced Danny. Reformed and fresh out of prison, Derek severs contact with the gang and becomes determined to keep Danny from going down the same violent path as he did.", "Tony Kaye", 2, "AmericanHistoryX.jpg", 0, 119, "American History X", "https://www.youtube.com/watch?v=XfQYHqsiN5g", 0m },
                    { 34, "60223fcf-5fa4-434f-a4ba-9389a4f571a0", "It is the height of the war in Vietnam, and U.S. Army Captain Willard is sent by Colonel Lucas and a General to carry out a mission that, officially, 'does not exist - nor will it ever exist'. The mission: To seek out a mysterious Green Beret Colonel, Walter Kurtz, whose army has crossed the border into Cambodia and is conducting hit-and-run missions against the Viet Cong and NVA. The army believes Kurtz has gone completely insane and Willard's job is to eliminate him. Willard, sent up the Nung River on a U.S. Navy patrol boat, discovers that his target is one of the most decorated officers in the U.S. Army. His crew meets up with surfer-type Lt-Colonel Kilgore, head of a U.S Army helicopter cavalry group which eliminates a Viet Cong outpost to provide an entry point into the Nung River. After some hair-raising encounters, in which some of his crew are killed, Willard, Lance and Chef reach Colonel Kurtz's outpost, beyond the Do Lung Bridge. Now, after becoming prisoners of Kurtz, will Willard &amp; the others be able to fulfill their mission?", "Francis Ford Coppola", 1, "ApocalypseNow.jpg", 0, 147, "Apocalypse Now", "https://www.youtube.com/watch?v=9l-ViOOFH-s", 0m },
                    { 35, "a9b6dc74-38a5-4794-a703-59204f461adb", "Over 10 years have passed since the first machine called The Terminator tried to kill Sarah Connor and her unborn son, John. The man who will become the future leader of the human resistance against the Machines is now a healthy young boy. However, another Terminator, called the T-1000, is sent back through time by the supercomputer Skynet. This new Terminator is more advanced and more powerful than its predecessor and its mission is to kill John Connor when he's still a child. However, Sarah and John do not have to face the threat of the T-1000 alone. Another Terminator (identical to the same model that tried and failed to kill Sarah Connor in 1984) is also sent back through time to protect them. Now, the battle for tomorrow has begun.", "James Cameron", 4, "Terminator2JudgmentDay.jpg", 0, 137, "Terminator 2: Judgment Day", "https://www.youtube.com/watch?v=CRRlbK5w8AE", 0m },
                    { 36, "60223fcf-5fa4-434f-a4ba-9389a4f571a0", "Opening with the Allied invasion of Normandy on 6 June 1944, members of the 2nd Ranger Battalion under Cpt. Miller fight ashore to secure a beachhead. Amidst the fighting, two brothers are killed in action. Earlier in New Guinea, a third brother is KIA. Their mother, Mrs. Ryan, is to receive all three of the grave telegrams on the same day. The United States Army Chief of Staff, George C. Marshall, is given an opportunity to alleviate some of her grief when he learns of a fourth brother, Private James Ryan, and decides to send out 8 men (Cpt. Miller and select members from 2nd Rangers) to find him and bring him back home to his mother...", "Steven Spielberg", 1, "SavingPrivateRyan.jpg", 0, 169, "Saving Private Ryan", "https://www.youtube.com/watch?v=9CiW_DgxCnQ", 0m },
                    { 37, "2055e8c8-5a8e-49c3-9f0a-a987700af2ee", "Memento chronicles two separate stories of Leonard, an ex-insurance investigator who can no longer build new memories, as he attempts to find the murderer of his wife, which is the last thing he remembers. One story line moves forward in time while the other tells the story backwards revealing more each time.", "Christopher Nolan", 7, "Memento.jpg", 0, 113, "Memento", "https://www.youtube.com/watch?v=4CV41hoyS8A", 0m },
                    { 38, "64ca1994-bfd0-4d26-8ec4-4d1bc82bd95c", "A tramp falls in love with a beautiful blind girl. Her family is in financial trouble. The tramp's on-and-off friendship with a wealthy man allows him to be the girl's benefactor and suitor.", "Charles Chaplin", 9, "CityLights.jpg", 0, 87, "City Lights", "https://www.youtube.com/watch?v=7vl7F8S4cpQ", 0m },
                    { 39, "a9b6dc74-38a5-4794-a703-59204f461adb", "Paranoid Brigadier General Jack D. Ripper of Burpelson Air Force Base, believing that fluoridation of the American water supply is a Soviet plot to poison the U.S. populace, is able to deploy through a back door mechanism a nuclear attack on the Soviet Union without the knowledge of his superiors, including the Chair of the Joint Chiefs of Staff, General Buck Turgidson, and President Merkin Muffley. Only Ripper knows the code to recall the B-52 bombers and he has shut down communication in and out of Burpelson as a measure to protect this attack. Ripper's executive officer, RAF Group Captain Lionel Mandrake (on exchange from Britain), who is being held at Burpelson by Ripper, believes he knows the recall codes if he can only get a message to the outside world. Meanwhile at the Pentagon War Room, key persons including Muffley, Turgidson and nuclear scientist and adviser, a former Nazi named Dr. Strangelove, are discussing measures to stop the attack or mitigate its blow-up into an all out nuclear war with the Soviets. Against Turgidson's wishes, Muffley brings Soviet Ambassador Alexi de Sadesky into the War Room, and get his boss, Soviet Premier Dimitri Kisov, on the hot line to inform him of what's going on. The Americans in the War Room are dismayed to learn that the Soviets have an as yet unannounced Doomsday Device to detonate if any of their key targets are hit. As Ripper, Mandrake and those in the War Room try and work the situation to their end goal, Major T.J. \"King\" Kong, one of the B-52 bomber pilots, is working on his own agenda of deploying his bomb where ever he can on enemy soil if he can't make it to his intended target.", "Stanley Kubrick", 9, "Dr.StrangeloveorHowILearnedtoStopWorryingandLovetheBomb.jpg", 0, 95, "Dr. Strangelove or: How I Learned to Stop Worrying and Love the Bomb", "https://www.youtube.com/watch?v=jPU1AYTxwg4", 0m },
                    { 40, "8980e4ca-2628-490d-840a-9c9414ab9f33", "In the distant future, the crew of the commercial spaceship Nostromo are on their way home when they pick up a distress call from a distant moon. The crew are under obligation to investigate and the spaceship descends on the moon afterwards. After a rough landing, three crew members leave the spaceship to explore the area on the moon. At the same time as they discover a hive colony of some unknown creature, the ship's computer deciphers the message to be a warning, not a distress call. When one of the eggs is disturbed, the crew realizes that they are not alone on the spaceship and they must deal with the consequences.", "Ridley Scott", 8, "Alien.jpg", 0, 117, "Alien", "https://www.youtube.com/watch?v=jQ5lPt9edzQ", 0m },
                    { 41, "a9b6dc74-38a5-4794-a703-59204f461adb", "Chaplin's last 'silent' film, filled with sound effects, was made when everyone else was making talkies. Charlie turns against modern society, the machine age, (The use of sound in films ?) and progress. Firstly we see him frantically trying to keep up with a production line, tightening bolts. He is selected for an experiment with an automatic feeding machine, but various mishaps leads his boss to believe he has gone mad, and Charlie is sent to a mental hospital - When he gets out, he is mistaken for a communist while waving a red flag, sent to jail, foils a jailbreak, and is let out again. We follow Charlie through many more escapades before the film is out.", "Charles Chaplin", 9, "ModernTimes.jpg", 0, 87, "Modern Times", "https://www.youtube.com/watch?v=NNznUyDmSFc", 0m },
                    { 42, "2055e8c8-5a8e-49c3-9f0a-a987700af2ee", "Chihiro and her parents are moving to a small Japanese town in the countryside, much to Chihiro's dismay. On the way to their new home, Chihiro's father makes a wrong turn and drives down a lonely one-lane road which dead-ends in front of a tunnel. Her parents decide to stop the car and explore the area. They go through the tunnel and find an abandoned amusement park on the other side, with its own little town. When her parents see a restaurant with great-smelling food but no staff, they decide to eat and pay later. However, Chihiro refuses to eat and decides to explore the theme park a bit more. She meets a boy named Haku who tells her that Chihiro and her parents are in danger, and they must leave immediately. She runs to the restaurant and finds that her parents have turned into pigs. In addition, the theme park turns out to be a town inhabited by demons, spirits, and evil gods. At the center of the town is a bathhouse where these creatures go to relax. The owner of the bathhouse is the evil witch Yubaba, who is intent on keeping all trespassers as captive workers, including Chihiro. Chihiro must rely on Haku to save her parents in hopes of returning to their world.", "Hayao Miyazaki", 10, "SpiritedAway.jpg", 0, 125, "Spirited Away", "https://www.youtube.com/watch?v=ByXuk9QqQkk", 0m },
                    { 43, "2055e8c8-5a8e-49c3-9f0a-a987700af2ee", "Madison Avenue advertising man Roger Thornhill finds himself thrust into the world of spies when he is mistaken for a man by the name of George Kaplan. Foreign spy Philip Vandamm and his henchman Leonard try to eliminate him but when Thornhill tries to make sense of the case, he is framed for murder. Now on the run from the police, he manages to board the 20th Century Limited bound for Chicago where he meets a beautiful blond, Eve Kendall, who helps him to evade the authorities. His world is turned upside down yet again when he learns that Eve isn't the innocent bystander he thought she was. Not all is as it seems however, leading to a dramatic rescue and escape at the top of Mt. Rushmore.", "Alfred Hitchcock", 4, "NorthbyNorthwest.jpg", 0, 136, "North by Northwest", "https://www.youtube.com/watch?v=ek7T9Gyl_J4", 0m },
                    { 44, "a9b6dc74-38a5-4794-a703-59204f461adb", "Marty McFly, a typical American teenager of the Eighties, is accidentally sent back to 1955 in a plutonium-powered DeLorean \"time machine\" invented by a slightly mad scientist. During his often hysterical, always amazing trip back in time, Marty must make certain his teenage parents-to-be meet and fall in love - so he can get back to the future.", "Robert Zemeckis", 3, "BacktotheFuture.jpg", 0, 116, "Back to the Future", "https://www.youtube.com/watch?v=qvsgGtivCgs", 0m },
                    { 45, "60223fcf-5fa4-434f-a4ba-9389a4f571a0", "In 1930s Italy, a carefree Jewish waiter named Guido starts a fairy tale life by courting and marrying a lovely woman from a nearby city. Guido and his wife have a son and live happily together until the occupation of Italy by German forces. In an attempt to hold his family together and help his son survive the horrors of a Jewish Concentration Camp, Guido imagines that the Holocaust is a game and that the grand prize for winning is a tank.", "Roberto Benigni", 9, "LifeIsBeautiful.jpg", 0, 116, "Life Is Beautiful", "https://www.youtube.com/watch?v=8CTjcVr9Iao", 0m },
                    { 46, "2055e8c8-5a8e-49c3-9f0a-a987700af2ee", "Haunted by a persistent writer's block, the aspiring author and recovering alcoholic, Jack Torrance, drags his wife, Wendy, and his gifted son, Danny, up snow-capped Colorado's secluded Overlook Hotel after taking up a job as an off-season caretaker. As the cavernous hotel shuts down for the season, the manager gives Jack a grand tour, and the facility's chef, the ageing Mr Hallorann, has a fascinating chat with Danny about a rare psychic gift called \"The Shining\", making sure to warn him about the hotel's abandoned rooms, and, in particular, the off-limits Room 237. However, instead of overcoming the dismal creative rut, little by little, Jack starts losing his mind, trapped in an unforgiving environment of seemingly endless snowstorms, and a gargantuan silent prison riddled with strange occurrences and eerie visions. Now, the incessant voices inside Jack's head demand sacrifice. Is Jack capable of murder?", "Stanley Kubrick", 1, "TheShining.jpg", 0, 146, "The Shining", "https://www.youtube.com/watch?v=S014oGZiSdI", 0m },
                    { 47, "218dcf68-aa10-4c63-994f-50853fb19296", "In this adaptation of the autobiography \"The Pianist: The Extraordinary True Story of One Man's Survival in Warsaw, 1939-1945,\" Wladyslaw Szpilman, a Polish Jewish radio station pianist, sees Warsaw change gradually as World War II begins. Szpilman is forced into the Warsaw Ghetto, but is later separated from his family during Operation Reinhard. From this time until the concentration camp prisoners are released, Szpilman hides in various locations among the ruins of Warsaw.", "Roman Polanski", 5, "ThePianist.jpg", 0, 150, "The Pianist", "https://www.youtube.com/watch?v=BFwGqLa_oAo", 0m },
                    { 48, "60223fcf-5fa4-434f-a4ba-9389a4f571a0", "A group of reporters are trying to decipher the last word ever spoken by Charles Foster Kane, the millionaire newspaper tycoon: \"Rosebud\". The film begins with a news reel detailing Kane's life for the masses, and then from there, we are shown flashbacks from Kane's life. As the reporters investigate further, the viewers see a display of a fascinating man's rise to fame, and how he eventually fell off the top of the world.", "Orson Welles", 1, "CitizenKane.jpg", 0, 119, "Citizen Kane", "https://www.youtube.com/watch?v=8dxh3lwdOFw", 0m },
                    { 49, "ea811464-0c63-4c45-ac26-d4eb5bff334f", "In this crime-action tour de force, the South Boston state police force is waging war on Irish-American organized crime. Young undercover cop Billy Costigan is assigned to infiltrate the mob syndicate run by gangland chief Frank Costello. While Billy quickly gains Costello's confidence, Colin Sullivan, a hardened young criminal who has infiltrated the state police as an informer for the syndicate is rising to a position of power in the Special Investigation Unit. Each man becomes deeply consumed by their double lives, gathering information about the plans and counter-plans of the operations they have penetrated. But when it becomes clear to both the mob and the police that there is a mole in their midst, Billy and Colin are suddenly in danger of being caught and exposed to the enemy - and each must race to uncover the identity of the other man in time to save themselves. But is either willing to turn on their friends and comrades they've made during their long stints undercover?", "Martin Scorsese", 2, "TheDeparted.jpg", 0, 151, "The Departed", "https://www.youtube.com/watch?v=iojhqm0JTW4", 0m },
                    { 50, "60223fcf-5fa4-434f-a4ba-9389a4f571a0", "There have been a rash of child abductions and murders in Berlin. The murderer lures the children into his confidence by candy and other such child friendly items. Everyone is on edge because the murderer has not been caught. The most substantial pieces of evidence the police have are hand written letters by the murderer which he sent to the newspaper for publication. Unknown even to himself, a blind beggar, who sold the murderer a balloon for one of the child victims, may have key information as to the murderer's identity. The murder squad's work is made even more difficult with the large number of tips they receive from the paranoid public, who are quick to accuse anyone of suspicious activity solely for their own piece of mind that someone - anyone - is apprehended for the heinous crimes. Conversely, many want to take the case into their own hands, including the town's leading criminals since the increased police presence has placed a strain on their ability to conduct criminal activity. Although they both have the same end goal of capturing the murderer, the police and the criminals seem to be working at cross purposes, which may provide an edge to the murderer in getting away.", "Fritz Lang", 2, "M.jpg", 0, 99, "M", "https://www.youtube.com/watch?v=nsVproWjN6c", 0m },
                    { 51, "a9b6dc74-38a5-4794-a703-59204f461adb", "The futility and irony of the war in the trenches in WWI is shown as a unit commander in the French army must deal with the mutiny of his men and a glory-seeking general after part of his force falls back under fire in an impossible attack.", "Stanley Kubrick", 1, "PathsofGlory.jpg", 0, 88, "Paths of Glory", "https://www.youtube.com/watch?v=AV9XLjDbt5A", 0m },
                    { 52, "ea811464-0c63-4c45-ac26-d4eb5bff334f", "Following his early retirement as a detective from the San Francisco Police Department, John Ferguson - Scottie to his friends - becomes obsessed with two women in succession, those obsessions which trouble his long time friend and former fiancée, Midge Wood, a designer of women's undergarments. The first is wealthy and elegant platinum blonde Madeleine Elster, the wife of his college acquaintance Gavin Elster, who hires John to follow her in Gavin's belief that she may be a danger to herself in thinking that she has recently been possessed by the spirit of Carlotta Valdes, Madeleine's great-grandmother who she knows nothing about, but who Gavin knows committed suicide in being mentally unbalanced when she was twenty-six, Madeleine's current age. The second is Judy Barton, who John spots on the street one day. Judy is a working class girl, but what makes John obsessed with her is that, despite her working class style and her brunette hair, she is the spitting image of Madeleine, into who he tries to transform Judy. The initial question that John has is if there is some connection between Madeleine and Judy. What happens between John and individually with Madeleine and Judy is affected by the reason John took that early retirement: a recent workplace incident that showed that he is acrophobic which leads to a severe case of vertigo whenever he looks down from tall heights.", "Alfred Hitchcock", 7, "Vertigo.jpg", 0, 128, "Vertigo", "https://www.youtube.com/watch?v=Z5jvQwwHQNY", 0m },
                    { 53, "610ab053-2c5a-451b-9634-03b59ea4a473", "In 1858, a bounty-hunter named King Schultz seeks out a slave named Django and buys him because he needs him to find some men he is looking for. After finding them, Django wants to find his wife, Broomhilda, who along with him were sold separately by his former owner for trying to escape. Schultz offers to help him if he chooses to stay with him and be his partner. Eventually they learn that she was sold to a plantation in Mississippi. Knowing they can't just go in and say they want her, they come up with a plan so that the owner will welcome them into his home and they can find a way.", "Quentin Tarantino", 1, "DjangoUnchained.jpg", 0, 165, "Django Unchained", "https://www.youtube.com/watch?v=0fUCuvNlOCg", 0m },
                    { 54, "a9b6dc74-38a5-4794-a703-59204f461adb", "In 1938, Walter Neff, an experienced salesman of the Pacific All Risk Insurance Co., meets the seductive wife of one of his clients, Phyllis Dietrichson, and they have an affair. Phyllis proposes to kill her husband to receive the proceeds of an accident insurance policy and Walter devises a scheme to receive twice the amount based on a double indemnity clause. When Mr. Dietrichson is found dead on a train track, the police accept the determination of accidental death. However, the insurance analyst and Walter's best friend Barton Keyes does not buy the story and suspects that Phyllis has murdered her husband with the help of another man.", "Billy Wilder", 2, "DoubleIndemnity.jpg", 0, 107, "Double Indemnity", "https://www.youtube.com/watch?v=yKrrAa2o9Eg", 0m },
                    { 55, "218dcf68-aa10-4c63-994f-50853fb19296", "Despite his tarnished reputation after the events of The Dark Knight (2008), in which he took the rap for Dent's crimes, Batman feels compelled to intervene to assist the city and its Police force, which is struggling to cope with Bane's plans to destroy the city.", "Christopher Nolan", 4, "TheDarkKnightRises.jpg", 0, 164, "The Dark Knight Rises", "https://www.youtube.com/watch?v=GokKUqLcvD8", 0m }
                });

            migrationBuilder.InsertData(
                table: "Movies",
                columns: new[] { "Id", "AddedById", "Description", "Director", "GenreId", "ImageUrl", "RatingCount", "RunningTime", "Title", "TrailerUrl", "UserRating" },
                values: new object[,]
                {
                    { 56, "218dcf68-aa10-4c63-994f-50853fb19296", "57 years after Ellen Ripley had a close encounter with the reptilian alien creature from the first movie, she is called back, this time, to help a group of highly trained colonial marines fight off against the sinister extraterrestrials. But this time, the aliens have taken over a space colony on the moon LV-426. When the colonial marines are called upon to search the deserted space colony, they later find out that they are up against more than what they bargained for. Using specially modified machine guns and enough firepower, it's either fight or die as the space marines battle against the aliens. As the Marines do their best to defend themselves, Ripley must attempt to protect a young girl who is the sole survivor of the nearly wiped out space colony.", "James Cameron", 4, "Aliens.jpg", 0, 137, "Aliens", "https://www.youtube.com/watch?v=oSeQQlaCZgU", 0m },
                    { 57, "8980e4ca-2628-490d-840a-9c9414ab9f33", "Travis Bickle is an ex-Marine and Vietnam War veteran living in New York City. As he suffers from insomnia, he spends his time working as a taxi driver at night, watching porn movies at seedy cinemas during the day, or thinking about how the world, New York in particular, has deteriorated into a cesspool. He's a loner who has strong opinions about what is right and wrong with mankind. For him, the one bright spot in New York humanity is Betsy, a worker on the presidential nomination campaign of Senator Charles Palantine. He becomes obsessed with her. After an incident with her, he believes he has to do whatever he needs to make the world a better place in his opinion. One of his priorities is to be the savior for Iris, a twelve-year-old runaway and prostitute who he believes wants out of the profession and under the thumb of her pimp and lover Matthew.", "Martin Scorsese", 2, "TaxiDriver.jpg", 0, 114, "Taxi Driver", "https://www.youtube.com/watch?v=T5IligQP7Fo", 0m },
                    { 58, "2055e8c8-5a8e-49c3-9f0a-a987700af2ee", "After his death sometime in his 43rd year, suburbanite Lester Burnham tells of the last few weeks of his life, during which he had no idea of his imminent passing. He is a husband to real estate agent Carolyn Burnham and father to high school student Jane Burnham. Although Lester and Carolyn once loved each other, they now merely tolerate each other. Typical wallflower Jane also hates both her parents; the three suffer individually in silence in their home life. Jane tries to steer clear of both her parents. Carolyn, relatively new to the real estate business, wants to create the persona of success to further her career, aspiring to the professional life of Buddy Kane, the king of the real estate business in their neighborhood. Lester merely walks mindlessly through life, including at his job in advertising. His company is downsizing, and he, like all the other employees, has to justify his position to the newly hired efficiency expert to keep his job. Things change for Lester when he falls in love at first sight with Jane's more experienced classmate, Angela Hayes. Both Janie and Angela can see Lester's sexual infatuation with Angela, who courts such attention from any man as a sign that she is model material, she having once appeared in Seventeen and is a career to which she aspires. Lester's infatuation with Angela gives him a reenergized view on life, where he openly doesn't care anymore what anyone thinks about what he does, anyone except Angela. This infatuation coincides with the Fittses moving in next door: homophobic disciplinarian US Marine Colonel Frank Fitts who rules the house with a military fist (that fist being both figurative and literal), his semi-comatose wife Barbara Fitts, and their bright and quietly subversive 18-year-old son Ricky Fitts, who openly abides by his father's rules while behind the scenes lives by his own quite different perspective. Much like Lester's infatuation, Ricky immediately becomes infatuated with Jane; he considers girls like Angela as ordinary. The entry of Angela and the Fittses into the Burnhams' lives ultimately leads to each of the players confronting what is truly in his or her heart.", "Sam Mendes", 1, "AmericanBeauty.jpg", 0, 122, "American Beauty", "https://www.youtube.com/watch?v=Ly7rq5EsTC8", 0m },
                    { 59, "64ca1994-bfd0-4d26-8ec4-4d1bc82bd95c", "Death Row guards at a penitentiary, in the 1930's, have a moral dilemma with their job when they discover one of their prisoners, a convicted murderer, has a special gift.", "Frank Darabont", 2, "TheGreenMile.jpg", 0, 189, "The Green Mile", "https://www.youtube.com/watch?v=Ki4haFrqSrw", 0m },
                    { 60, "2055e8c8-5a8e-49c3-9f0a-a987700af2ee", "Maximus is a powerful Roman general, loved by the people and the aging Emperor, Marcus Aurelius. Before his death, the Emperor chooses Maximus to be his heir over his own son, Commodus, and a power struggle leaves Maximus and his family condemned to death. The powerful general is unable to save his family, and his loss of will allows him to get captured and put into the Gladiator games until he dies. The only desire that fuels him now is the chance to rise to the top so that he will be able to look into the eyes of the man who will feel his revenge.", "Ridley Scott", 4, "Gladiator.jpg", 0, 155, "Gladiator", "https://www.youtube.com/watch?v=P5ieIbInFpg", 0m },
                    { 61, "ea811464-0c63-4c45-ac26-d4eb5bff334f", "In Paris, the aristocratic and intellectual Philippe is a quadriplegic millionaire who is interviewing candidates for the position of his carer, with his red-haired secretary Magalie. Out of the blue, Driss cuts the line of candidates and brings a document from the Social Security and asks Phillipe to sign it to prove that he is seeking a job position so he can receive his unemployment benefit. Philippe challenges Driss, offering him a trial period of one month to gain experience helping him. Then Driss can decide whether he would like to stay with him or not. Driss accepts the challenge and moves to the mansion, changing the boring life of Phillipe and his employees.", "Olivier Nakache, Éric Toledano", 5, "TheIntouchables.jpg", 0, 112, "The Intouchables", "https://www.youtube.com/watch?v=oK5hMNxqsFA", 0m },
                    { 62, "218dcf68-aa10-4c63-994f-50853fb19296", "In a distant, but not so unrealistic, future where mankind has abandoned earth because it has become covered with trash from products sold by the powerful multi-national Buy N Large corporation, WALL-E, a garbage collecting robot has been left to clean up the mess. Mesmerized with trinkets of Earth's history and show tunes, WALL-E is alone on Earth except for a sprightly pet cockroach. One day, EVE, a sleek (and dangerous) reconnaissance robot, is sent to Earth to find proof that life is once again sustainable. WALL-E falls in love with EVE. WALL-E rescues EVE from a dust storm and shows her a living plant he found amongst the rubble. Consistent with her \"directive\", EVE takes the plant and automatically enters a deactivated state except for a blinking green beacon. WALL-E, doesn't understand what has happened to his new friend, but, true to his love, he protects her from wind, rain, and lightning, even as she is unresponsive. One day a massive ship comes to reclaim EVE, but WALL-E, out of love or loneliness, hitches a ride on the outside of the ship to rescue EVE. The ship arrives back at a large space cruise ship, which is carrying all of the humans who evacuated Earth 700 years earlier. The people of Earth ride around this space resort on hovering chairs which give them a constant feed of TV and video chatting. They drink all of their meals through a straw out of laziness and/or bone loss, and are all so fat that they can barely move. When the auto-pilot computer, acting on hastily-given instructions sent many centuries before, tries to prevent the people of Earth from returning by stealing the plant, WALL-E, EVE, the portly captain, and a band of broken robots stage a mutiny.", "Andrew Stanton", 10, "WALL·E.jpg", 0, 98, "WALL·E", "https://www.youtube.com/watch?v=CZ1CATNbXg0", 0m },
                    { 63, "610ab053-2c5a-451b-9634-03b59ea4a473", "Gerd Wiesler is an officer with the Stasi, the East German secret police. The film begins in 1984 when Wiesler attends a play written by Georg Dreyman, who is considered by many to be the ultimate example of the loyal citizen. Wiesler has a gut feeling that Dreyman can't be as ideal as he seems, and believes surveillance is called for. The Minister of Culture agrees but only later does Wiesler learn that the Minister sees Dreyman as a rival and lusts after his partner Christa-Maria. The more time he spends listening in on them, the more he comes to care about them. The once rigid Stasi officer begins to intervene in their lives, in a positive way, protecting them whenever possible. Eventually, Wiesler's activities catch up to him and while there is no proof of wrongdoing, he finds himself in menial jobs - until the unbelievable happens.", "Florian Henckel von Donnersmarck", 1, "TheLivesofOthers.jpg", 0, 137, "The Lives of Others", "https://www.youtube.com/watch?v=n3_iLOp6IhM", 0m },
                    { 64, "a9b6dc74-38a5-4794-a703-59204f461adb", "Woody, Buzz and the whole gang are back. As their owner Andy prepares to depart for college, his loyal toys find themselves in daycare where untamed tots with their sticky little fingers do not play nice. So, it's all for one and one for all as they join Barbie's counterpart Ken, a thespian hedgehog named Mr. Pricklepants and a pink, strawberry-scented teddy bear called Lots-o'-Huggin' Bear to plan their great escape.", "Lee Unkrich", 10, "ToyStory3.jpg", 0, 103, "Toy Story 3", "https://www.youtube.com/watch?v=2BlMNH1QTeE", 0m },
                    { 65, "218dcf68-aa10-4c63-994f-50853fb19296", "20 years after the end of WWI, in which the nation of Tomainia was on the losing side, Adenoid Hynkel has risen to power as the ruthless dictator of the country. He believes in a pure Aryan state and the decimation of the Jews. This situation is unknown to a simple Jewish Tomainian barber who has been hospitalized since a WWI battle. Upon his release the barber, who had been suffering from memory loss about the war, is shown the new persecuted life of the Jews by many living in the Jewish ghetto, including a washerwoman named Hannah with whom he begins a relationship. The barber is ultimately spared such persecution by Commander Schultz, whom he saved in that WWI battle. The lives of all Jews in Tomainia are eventually spared with a policy shift by Hynkel himself, who is doing so for ulterior motives. But those motives include a desire for world domination, starting with the invasion of neighboring Osterlich, which may be threatened by Benzino Napaloni, the dictator of neighboring Bacteria. Ultimately Schultz, who has turned traitor against Hynkel's regime, and the barber may be able to join forces to take control of the situation, using Schultz's inside knowledge of the regime's workings and the barber's uncanny resemblance to one of those in power.", "Charles Chaplin", 9, "TheGreatDictator.jpg", 0, 125, "The Great Dictator", "https://www.youtube.com/watch?v=k8bVG8XC-4I", 0m },
                    { 66, "64ca1994-bfd0-4d26-8ec4-4d1bc82bd95c", "In the end of the nineteenth century, in London, Robert Angier, his beloved wife Julia McCullough, and Alfred Borden are friends and assistants of a magician. When Julia accidentally dies during a performance, Robert blames Alfred for her death, and they become enemies. Both become famous and rival magicians, sabotaging the performance of the other on the stage. When Alfred performs a successful trick, Robert becomes obsessed trying to disclose the secret of his competitor with tragic consequences.", "Christopher Nolan", 1, "ThePrestige.jpg", 0, 130, "The Prestige", "https://www.youtube.com/watch?v=ELq7V8vkekI", 0m },
                    { 67, "218dcf68-aa10-4c63-994f-50853fb19296", "Protagonist Alex DeLarge is an \"ultraviolent\" youth in futuristic Britain. As with all luck, his eventually runs out and he's arrested and convicted of murder. While in prison, Alex learns of an experimental program in which convicts are programmed to detest violence. If he goes through the program, his sentence will be reduced and he will be back on the streets sooner than expected. But Alex's ordeals are far from over once he hits the streets of Britain..", "Stanley Kubrick", 2, "AClockworkOrange.jpg", 0, 136, "A Clockwork Orange", "https://www.youtube.com/watch?v=T54uZPI4Z8A", 0m },
                    { 68, "2055e8c8-5a8e-49c3-9f0a-a987700af2ee", "Due to his knowledge of the native Bedouin tribes, British Lieutenant T.E. Lawrence is sent to Arabia to find Prince Faisal and serve as a liaison between the Arabs and the British in their fight against the Turks. With the aid of native Sherif Ali, Lawrence rebels against the orders of his superior officer and strikes out on a daring camel journey across the harsh desert to attack a well-guarded Turkish port.", "David Lean", 3, "LawrenceofArabia.jpg", 0, 218, "Lawrence of Arabia", "https://www.youtube.com/watch?v=vOlRhGEhG7k", 0m },
                    { 69, "2055e8c8-5a8e-49c3-9f0a-a987700af2ee", "Amélie is a story about a girl named Amélie whose childhood was suppressed by her Father's mistaken concerns of a heart defect. With these concerns Amélie gets hardly any real-life contact with other people. This leads Amélie to resort to her own fantastical world and dreams of love and beauty. She later on becomes a young woman and moves to the central part of Paris as a waitress. After finding a lost treasure belonging to the former occupant of her apartment, she decides to return it to him. After seeing his reaction and his new found perspective - she decides to devote her life to the people around her. Such as, her father who is obsessed with his garden-gnome, a failed writer, a hypochondriac, a man who stalks his ex girlfriends, the \"ghost,\" a suppressed young soul, the love of her life and a man whose bones are as brittle as glass. But after consuming herself with these escapades - she finds out that she is disregarding her own life and damaging her quest for love. Amélie then discovers she must become more aggressive and take a hold of her life and capture the beauty of love she has always dreamed of.", "Jean-Pierre Jeunet", 9, "Amélie.jpg", 0, 122, "Amélie", "https://www.youtube.com/watch?v=HUECWi5pX7o", 0m },
                    { 70, "218dcf68-aa10-4c63-994f-50853fb19296", "Small-town Alabama, 1932. Atticus Finch (played by Gregory Peck) is a lawyer and a widower. He has two young children, Jem and Scout. Atticus Finch is currently defending Tom Robinson, a black man accused of raping a white woman. Meanwhile, Jem and Scout are intrigued by their neighbours, the Radleys, and the mysterious, seldom-seen Boo Radley in particular.", "Robert Mulligan", 2, "ToKillaMockingbird.jpg", 0, 129, "To Kill a Mockingbird", "https://www.youtube.com/watch?v=KR7loA_oziY", 0m },
                    { 71, "2055e8c8-5a8e-49c3-9f0a-a987700af2ee", "Six thugs, who are strangers to each other, are hired by a crime boss, Joe Cabot, to carry out a diamond robbery. Right at the outset, they are given false names with the intention that they won't get too close and will concentrate on the job instead. They are completely sure that the robbery is going to be a success. But, when the police show up right at the time and the site of the robbery, panic spreads amongst the group members, and two of them are killed in the subsequent shootout, along with a few policemen and civilians. When the remaining people assemble at the premeditated rendezvous point (a warehouse), they begin to suspect that one of them is an undercover cop.", "Quentin Tarantino", 2, "ReservoirDogs.jpg", 0, 99, "Reservoir Dogs", "https://www.youtube.com/watch?v=vayksn4Y93A", 0m },
                    { 72, "610ab053-2c5a-451b-9634-03b59ea4a473", "It is 1942 and the German submarine fleet is heavily engaged in the so-called \"Battle of the Atlantic\" to harass and destroy British shipping. With better escorts of the destroyer class, however, German U-boats have begun to take heavy losses. \"Das Boot\" is the story of the crew of one such U-Boat, with the film examining how these submariners maintained their professionalism as soldiers and attempted to accomplish impossible missions, all the while attempting to understand and obey the ideology of the government under which they served.", "Wolfgang Petersen", 1, "DasBoot.jpg", 0, 149, "Das Boot", "https://www.youtube.com/watch?v=7pzKyeIex2Y", 0m },
                    { 73, "ea811464-0c63-4c45-ac26-d4eb5bff334f", "A young lion prince is cast out of his pride by his cruel uncle, who claims he killed his father. While the uncle rules with an iron paw, the prince grows up beyond the Savannah, living by a philosophy: No worries for the rest of your days. But when his past comes to haunt him, the young prince must decide his fate: Will he remain an outcast or face his demons and become what he needs to be?", "Roger Allers, Rob Minkoff", 10, "TheLionKing.jpg", 0, 88, "The Lion King", "https://www.youtube.com/watch?v=eHcZlPpNt0Q", 0m },
                    { 74, "5556c45e-395d-402b-b765-750666b092fc", "A boy who grew up in a native Sicilian Village returns home as a famous director after receiving news about the death of an old friend. Told in a flashback, Salvatore reminiscences about his childhood and his relationship with Alfredo, a projectionist at Cinema Paradiso. Under the fatherly influence of Alfredo, Salvatore fell in love with film making, with the duo spending many hours discussing about films and Alfredo painstakingly teaching Salvatore the skills that became a stepping stone for the young boy into the world of film making. The film brings the audience through the changes in cinema and the dying trade of traditional film making, editing and screening. It also explores a young boy's dream of leaving his little town to foray into the world outside.", "Giuseppe Tornatore", 1, "CinemaParadiso.jpg", 0, 155, "Cinema Paradiso", "https://www.youtube.com/watch?v=JMyVSD6OvO8", 0m },
                    { 75, "218dcf68-aa10-4c63-994f-50853fb19296", "Luke Skywalker battles Jabba the Hutt and Darth Vader to save his comrades in the Rebel Alliance and triumph over the Galactic Empire. Han Solo and Princess Leia reaffirm their love, and team with Chewbacca, Lando Calrissian, the Ewoks, and droids C-3PO and R2-D2 to aid in the disruption of the Dark Side, and the defeat of the evil emperor.", "Richard Marquand", 4, "StarWarsEpisodeVI-ReturnoftheJedi.jpg", 0, 131, "Star Wars: Episode VI - Return of the Jedi", "https://www.youtube.com/watch?v=p4vIFhk621Q", 0m },
                    { 76, "5556c45e-395d-402b-b765-750666b092fc", "Fred C. Dobbs and Bob Curtin, both down on their luck in Tampico, Mexico in 1925, meet up with a grizzled prospector named Howard and decide to join with him in search of gold in the wilds of central Mexico. Through enormous difficulties, they eventually succeed in finding gold, but bandits, the elements, and most especially greed threaten to turn their success into disaster.", "John Huston", 3, "TheTreasureoftheSierraMadre.jpg", 0, 126, "The Treasure of the Sierra Madre", "https://www.youtube.com/watch?v=XZ8Q9mOYJgE", 0m },
                    { 77, "5556c45e-395d-402b-b765-750666b092fc", "An out of work pulp fiction novelist, Holly Martins, arrives in a post war Vienna divided into sectors by the victorious allies, and where a shortage of supplies has led to a flourishing black market. He arrives at the invitation of an ex-school friend, Harry Lime, who has offered him a job, only to discover that Lime has recently died in a peculiar traffic accident. From talking to Lime's friends and associates Martins soon notices that some of the stories are inconsistent, and determines to discover what really happened to Harry Lime.", "Carol Reed", 11, "TheThirdMan.jpg", 0, 93, "The Third Man", "https://www.youtube.com/watch?v=r9yyDEDGlr0", 0m },
                    { 78, "ea811464-0c63-4c45-ac26-d4eb5bff334f", "With the vivid memory of his long-gone childhood friends Max, Patsy, and Cockeye etched in his mind, his ferociously loyal partners-in-crime during their rise to prominence in New York's Prohibition-era Lower East Side, the defeated, penniless, and guilt-ridden former gangster David \"Noodles\" Aaronson returns to Manhattan. Not knowing what to expect on his mission to shed light on his opaque past, grizzled Noodles reunites with his only living friend Fat Moe after 35 haunted years of self-exile. However, the relentless, piercing sound of culpability stands in the way of finding closure, as the inscrutable content of a well-worn leather suitcase further complicates matters. And now, against the backdrop of a torn conscience, the sad, bittersweet recollections of more than 50 years of love, death, and everything in-between become inextricably intertwined, leading to even more puzzling questions. But what are a man's options when he is left with nothing?", "Sergio Leone", 2, "OnceUponaTimeinAmerica.jpg", 0, 229, "Once Upon a Time in America", "https://www.youtube.com/watch?v=LcpCRyNo8T8", 0m },
                    { 79, "610ab053-2c5a-451b-9634-03b59ea4a473", "Sara Goldfarb (Ellen Burstyn) is a retired widow, living in a small apartment. She spends most of her time watching TV, especially a particular self-help show. She has delusions of rising above her current dull existence by being a guest on that show. Her son, Harry (Jared Leto) is a junkie but along with his friend Tyrone (Marlon Wayans) has visions of making it big by becoming a drug dealer. Harry's girlfriend Marion (Jennifer Connelly) could be fashion designer or artist but is swept along in Harry's drug-centric world. Meanwhile Sara has developed an addiction of her own. She desperately wants to lose weight and so goes on a crash course involving popping pills, pills which turn out to be very addictive and harmful to her mental state.", "Darren Aronofsky", 1, "RequiemforaDream.jpg", 0, 102, "Requiem for a Dream", "https://www.youtube.com/watch?v=QBwzN4v1vA0", 0m },
                    { 80, "610ab053-2c5a-451b-9634-03b59ea4a473", "Much to his surprise, timid Joel Barish is shocked to discover that the love of his life, sparky Clementine, has had him erased from her memory. To pay her back in the same coin, poor Joel summons up the courage to undergo a painless but intricate medical procedure to do the same, utterly unaware that darkness is an essential part of the light. Now, as hurt and angry Joel's ugly recollections of Clementine gradually fade away, giving way to a soulless black void, suddenly, he begins having second thoughts, toying with the idea of stopping the irreversible process. In the end, is ignorance really bliss?", "Michel Gondry", 1, "EternalSunshineoftheSpotlessMind.jpg", 0, 108, "Eternal Sunshine of the Spotless Mind", "https://www.youtube.com/watch?v=07-QBnEkgXU", 0m },
                    { 81, "a9b6dc74-38a5-4794-a703-59204f461adb", "A two-segment look at the effect of the military mindset and war itself on Vietnam era Marines. The first half follows a group of recruits in boot camp under the command of the punishing Gunnery Sergeant Hartman. The second half shows one of those recruits, Joker, covering the war as a correspondent for Stars and Stripes, focusing on the Tet offensive.", "Stanley Kubrick", 1, "FullMetalJacket.jpg", 0, 116, "Full Metal Jacket", "https://www.youtube.com/watch?v=n2i917l5RFc", 0m },
                    { 82, "64ca1994-bfd0-4d26-8ec4-4d1bc82bd95c", "Abducted on a rainy night in 1988, the obnoxious drunk, Oh Dae-Su, much to his surprise, wakes up locked in a windowless and dilapidated hotel room, for an unknown reason. There, his invisible and pitiless captors will feed him, clothe him, and sedate him to avert a desperate suicide--and as his only companion and a window to the world is the TV in his stark cell--the only thing that helps Oh Dae-Su keep going is his daily journal. Then, unexpectedly, after fifteen long years in captivity, the perplexed prisoner is deliberately released, encouraged to track down his tormentor to finally get his retribution. However, who would hate Oh Dae-Su so much he would deny him of a quick and clean death?", "Park Chan-wook", 4, "Oldboy.jpg", 0, 120, "Oldboy", "https://www.youtube.com/watch?v=hBNBpNcuQHI", 0m },
                    { 83, "218dcf68-aa10-4c63-994f-50853fb19296", "William Wallace is a Scottish rebel who leads an uprising against the cruel English ruler Edward the Longshanks, who wishes to inherit the crown of Scotland for himself. When he was a young boy, William Wallace's father and brother, along with many others, lost their lives trying to free Scotland. Once he loses another of his loved ones, William Wallace begins his long quest to make Scotland free once and for all, along with the assistance of Robert the Bruce.", "Mel Gibson", 5, "Braveheart.jpg", 0, 178, "Braveheart", "https://www.youtube.com/watch?v=1NJO0jxBtMo", 0m },
                    { 84, "156fc675-02de-4250-9edb-869c85e13e61", "1950's Los Angeles is the seedy backdrop for this intricate noir-ish tale of police corruption and Hollywood sleaze. Three very different cops are all after the truth, each in their own style: Ed Exley, the golden boy of the police force, willing to do almost anything to get ahead, except sell out; Bud White, ready to break the rules to seek justice, but barely able to keep his raging violence under control; and Jack Vincennes, always looking for celebrity and a quick buck until his conscience drives him to join Exley and White down the one-way path to find the truth behind the dark world of L.A. crime.", "Curtis Hanson", 2, "L.A.Confidential.jpg", 0, 138, "L.A. Confidential", "https://www.youtube.com/watch?v=6sOXrY5yV4g", 0m },
                    { 85, "a9b6dc74-38a5-4794-a703-59204f461adb", "Antonio Ricci, an unemployed man in the depressed post-WWII economy of Italy, finally gets a job hanging up posters, but he needs a bicycle. But when his bicycle is stolen,, he and son walk the streets of Rome looking for it. Antonio finally manages to locate the thief, but with no proof he must abandon his cause. But he and his son know perfectly well that without a bike, Antonio won't be able to keep his job.", "Vittorio De Sica", 1, "BicycleThieves.jpg", 0, 89, "Bicycle Thieves", "https://www.youtube.com/watch?v=H2P4xo9kmPM", 0m },
                    { 86, "156fc675-02de-4250-9edb-869c85e13e61", "In 1937 Los Angeles, private investigator Jake 'J.J.' Gittes specializes in cheating-spouse cases. His current target is Hollis Mulwray, high-profile chief engineer for the Los Angeles Department of Water and Power, whose wife suspects him of infidelity. In following Mulwray, Gittes witnesses some usual business dealings, such as a public meeting for construction of a new dam to create additional water supply for Los Angeles, as fresh water is vital to the growing community during the chronic drought; Mulwray opposes the dam. Eventually Gittes sees Mulwray meeting with an unknown young woman who isn't his wife. Once news of the supposed tryst between Mulwray and this woman hits the media, additional information comes to light that makes Gittes believe that Mulwray is being framed for something and that he himself is being set up. In his investigation of the issue behind Mulwray's framing and his own setup, Gittes is assisted by Mulwray's wife Evelyn, but he thinks she isn't being forthright with him. The further he gets into the investigation, the more secrets he uncovers about the Mulwrays' professional and personal dealings, including Mulwray's former business-partnership with Evelyn's father, Noah Cross. The identity of the unknown woman may be the key to uncovering the whole story.", "Roman Polanski", 1, "Chinatown.jpg", 0, 130, "Chinatown", "https://www.youtube.com/watch?v=T37QkBc4IGY", 0m },
                    { 87, "218dcf68-aa10-4c63-994f-50853fb19296", "1927 Hollywood. Monumental Pictures' biggest stars, glamorous on-screen couple Lina Lamont and Don Lockwood, are also an off-screen couple if the trade papers and gossip columns are to be believed. Both perpetuate the public perception if only to please their adoring fans and bring people into the movie theaters. In reality, Don barely tolerates her, while Lina, despite thinking Don beneath her, simplemindedly believes what she sees on screen in order to bolster her own stardom and sense of self-importance. R.F. Simpson, Monumental's head, dismisses what he thinks is a flash in the pan: talking pictures. It isn't until The Jazz Singer (1927) becomes a bona fide hit which results in all the movie theaters installing sound equipment that R.F. knows Monumental, most specifically in the form of Don and Lina, have to jump on the talking picture bandwagon, despite no one at the studio knowing anything about the technology. Musician Cosmo Brown, Don's best friend, gets hired as Monumental's ideas man and musical director. And by this time, Don has secretly started dating Kathy Selden, a chorus girl who is trying to make it big in pictures herself. Don and Kathy's relationship is despite their less than friendly initial meeting. Cosmo and Kathy help Don, who had worked his way up through the movie ranks to stardom, try make the leap to talking picture stardom, with Kathy following along the way. However, they have to overcome the technological issues. But the bigger problem is Lina, who will do anything to ensure she also makes the successful leap into talking pictures, despite her own inabilities and at anyone and everyone else's expense if they get in her way, especially Kathy as Don's off screen girlfriend and possibly his new talking picture leading lady.", "Stanley Donen, Gene Kelly", 9, "Singin'intheRain.jpg", 0, 103, "Singin' in the Rain", "https://www.youtube.com/watch?v=5_EVHeNEIJY", 0m },
                    { 88, "156fc675-02de-4250-9edb-869c85e13e61", "While protecting his village from rampaging boar-god/demon, a confident young warrior, Ashitaka, is stricken by a deadly curse. To save his life, he must journey to the forests of the west. Once there, he's embroiled in a fierce campaign that humans were waging on the forest. The ambitious Lady Eboshi and her loyal clan use their guns against the gods of the forest and a brave young woman, Princess Mononoke, who was raised by a wolf-god. Ashitaka sees the good in both sides and tries to stem the flood of blood. This is met by animosity by both sides as they each see him as supporting the enemy.", "Hayao Miyazaki", 10, "PrincessMononoke.jpg", 0, 134, "Princess Mononoke", "https://www.youtube.com/watch?v=4OiMOHRDs14", 0m },
                    { 89, "218dcf68-aa10-4c63-994f-50853fb19296", "History is turned on its comic head when, in tenth-century England, King Arthur travels the countryside to find knights who will join him at the Round Table in Camelot. Gathering up the men is a tale in itself but after a bit of a party at Camelot, many decide to leave only to be stopped by God, who sends them on a quest: to find the Holy Grail. After a series of individual adventures, the knights are reunited but must face a wizard named Tim the Enchanter, killer rabbits and lessons in the use of holy hand grenades. Their quest comes to an end however when the Police intervene - just what you would expect in a Monty Python movie.", "Terry Gilliam, Terry Jones", 3, "MontyPythonandtheHolyGrail.jpg", 0, 91, "Monty Python and the Holy Grail", "https://www.youtube.com/watch?v=urRkGvhXc8w", 0m },
                    { 90, "610ab053-2c5a-451b-9634-03b59ea4a473", "Sometime in the future, the city of Metropolis is home to a Utopian society where its wealthy residents live a carefree life. One of those is Freder Fredersen. One day, he spots a beautiful woman with a group of children, she and the children quickly disappear. Trying to follow her, he is horrified to find an underground world of workers who apparently run the machinery that keeps the Utopian world above ground functioning. One of the few people above ground who knows about the world below is Freder's father, John Fredersen, who is the founder and master of Metropolis. Freder learns that the woman is called Maria, who espouses the need to join the \"hands\" - the workers - to the \"head\" - those in power above - by a mediator who will act as the \"heart\". Freder wants to help the plight of the workers in their struggle for a better life. But when John learns of what Maria is advocating and that Freder has joined their cause, with the assistance of an old colleague. an inventor called Rotwang, who turns out to be But their nemesis goes to works towards quashing a proposed uprising, with Maria at the centre of their plan. John, unaware that Rotwang has his own agenda., makes plans that include shutting down the machines, with the prospect of unleashing total anarchy both above and below ground.", "Fritz Lang", 1, "Metropolis.jpg", 0, 153, "Metropolis", "https://www.youtube.com/watch?v=gdtZv3XROnc", 0m },
                    { 91, "2055e8c8-5a8e-49c3-9f0a-a987700af2ee", "A priest, a woodcutter and another man are taking refuge from a rainstorm in the shell of a former gatehouse called Rashômon. The priest and the woodcutter are recounting the story of a murdered samurai whose body the woodcutter discovered three days earlier in a forest grove. Both were summoned to testify at the murder trial, the priest who ran into the samurai and his wife traveling through the forest just before the murder occurred. Three other people who testified at the trial are supposedly the only direct witnesses: a notorious bandit named Tajômaru, who allegedly murdered the samurai and raped his wife; the white veil cloaked wife of the samurai; and the samurai himself who testifies through the use of a medium. The three tell a similarly structured story - that Tajômaru kidnapped and bound the samurai so that he could rape the wife - but which ultimately contradict each other, the motivations and the actual killing being what differ. The woodcutter reveals at Rashômon that he knows more than he let on at the trial, thus bringing into question his own actions. But another discovery at Rashômon and the resulting actions from the discovery bring back into focus the woodcutter's own humanity or lack thereof.", "Akira Kurosawa", 2, "Rashomon.jpg", 0, 88, "Rashomon", "https://www.youtube.com/watch?v=Zqoyl2p8_lw", 0m },
                    { 92, "218dcf68-aa10-4c63-994f-50853fb19296", "After two Chicago musicians, Joe and Jerry, witness the the St. Valentine's Day massacre, they want to get out of town and get away from the gangster responsible, Spats Colombo. They're desperate to get a gig out of town but the only job they know of is in an all-girl band heading to Florida. They show up at the train station as Josephine and Daphne, the replacement saxophone and bass players. They certainly enjoy being around the girls, especially Sugar Kane Kowalczyk who sings and plays the ukulele. Joe in particular sets out to woo her while Jerry/Daphne is wooed by a millionaire, Osgood Fielding III. Mayhem ensues as the two men try to keep their true identities hidden and Spats Colombo and his crew show up for a meeting with several other crime lords.", "Billy Wilder", 9, "SomeLikeItHot.jpg", 0, 121, "Some Like It Hot", "https://www.youtube.com/watch?v=rI_lUHOCcbc", 0m },
                    { 93, "60223fcf-5fa4-434f-a4ba-9389a4f571a0", "Antonio Salieri believes that Wolfgang Amadeus Mozart's music is divine and miraculous. He wishes he was himself as good a musician as Mozart so that he can praise the Lord through composing. He began his career as a devout man who believes his success and talent as a composer are God's rewards for his piety. He's also content as the respected, financially well-off, court composer of Austrian Emperor Joseph II. But he's shocked to learn that Mozart is such a vulgar creature, and can't understand why God favored Mozart to be his instrument. Salieri's envy has made him an enemy of God whose greatness was evident in Mozart. He is ready to take revenge against God and Mozart for his own musical mediocrity.", "Milos Forman", 5, "Amadeus.jpg", 0, 160, "Amadeus", "https://www.youtube.com/watch?v=r7kWQj9FCGY", 0m },
                    { 94, "610ab053-2c5a-451b-9634-03b59ea4a473", "\"2001\" is a story of evolution. Sometime in the distant past, someone or something nudged evolution by placing a monolith on Earth (presumably elsewhere throughout the universe as well). Evolution then enabled humankind to reach the moon's surface, where yet another monolith is found, one that signals the monolith placers that humankind has evolved that far. Now a race begins between computers (HAL) and human (Bowman) to reach the monolith placers. The winner will achieve the next step in evolution, whatever that may be.", "Stanley Kubrick", 3, "2001ASpaceOdyssey.jpg", 0, 149, "2001: A Space Odyssey", "https://www.youtube.com/watch?v=oR_e9y-bka0", 0m },
                    { 95, "64ca1994-bfd0-4d26-8ec4-4d1bc82bd95c", "Eve Harrington (Anne Baxter) is waiting backstage to meet her idol, talented but aging Broadway star Margo Channing (Bette Davis). It seems innocent enough as Eve explains that she has seen Margo in EVERY performance of her current play. Margo and her friends take Eve under their wing but only theatre critic Addison DeWitt (George Sanders) sees through Eve's evil plan, which is to take Margo's parts and her fiancé, Bill Simpson (Gary Merrill) too.", "Joseph L. Mankiewicz", 1, "AllAboutEve.jpg", 0, 138, "All About Eve", "https://www.youtube.com/watch?v=uRjKPLH2OaQ", 0m },
                    { 96, "218dcf68-aa10-4c63-994f-50853fb19296", "Ailing barrister Sir Wilfrid Robarts is thrust back into the courtroom in what becomes one of the most unusual and eventful murder case of the lawyer's career when he finds himself defending Leonard Vole, a man being tried for the murder of a wealthy woman. With Robarts choosing to represent him, the two find themselves up against Leonard's cold-hearted wife, Christine - who, in a surprising turn of events, chooses to appear in court against her husband.", "Billy Wilder", 2, "WitnessfortheProsecution.jpg", 0, 116, "Witness for the Prosecution", "https://www.youtube.com/watch?v=GMlJfiA2u7Y", 0m },
                    { 97, "ea811464-0c63-4c45-ac26-d4eb5bff334f", "Johnny Hooker, a small time grifter, unknowingly steals from Doyle Lonnegan, a big time crime boss, when he pulls a standard street con. Lonnegan demands satisfaction for the insult. After his partner, Luther, is killed, Hooker flees, and seeks the help of Henry Gondorff, one of Luther's contacts, who is a master of the long con. Hooker wants to use Gondorff's expertise to take Lonnegan for an enormous sum of money to even the score, since he admits he \"doesn't know enough about killing to kill him.\" They devise a complicated scheme and amass a talented group of other con artists who want their share of the reparations. The stakes are high in this game, and our heroes must not only deal with Lonnegan's murderous tendencies, but also other side players who want a piece of the action. To win, Hooker and Gondorff will need all their skills...and a fair amount of confidence.", "George Roy Hill", 9, "TheSting.jpg", 0, 129, "The Sting", "https://www.youtube.com/watch?v=_nAIb_J9T5M", 0m }
                });

            migrationBuilder.InsertData(
